David Hoffman⁠
For as long as he can remember, David Hoffman’s entrepreneurial spirit has been strong. “When I was a kid, I sold mangoes from our trees on street corners and candy and muffins at school — anything to make my own money,” he says. “By the time I graduated high school, I was already a practicing real estate agent.” Today, as the Founder & CEO of the award-winning David’s Been Here YouTube channel, he creates travel videos and written travel guides to inspire his 1 million+ subscribers to venture beyond their backyard and leave their mark on the world.⁠
